import MainNavigation from "./Components/Layout/MainNavigation";
function App() {
  return (
    <div>

        <Routes>
        <Route path="/" element={<AllMeetupsPages />}/>
        <Route path="/favorites" element={<FavoritesPages />}/>
        <Route path="/new-meetup" element={<NewMeetUpPages />}/>

        </Routes>

    </div>
  );
}

export default App;
